import { createApp } from 'vue';
import App from './App.vue';
import '../node_modules/bootstrap/dist/css/bootstrap.css';
import router from './routes';
import axios from 'axios';





const app= createApp(App);
var editMode=false;
var ActiveUserId=0;
var ActiveUserType='';
var showNavBar=true;

app.config.globalProperties.editMode=editMode;
app.config.globalProperties.$ActiveUserId=ActiveUserId;
app.config.globalProperties.$ActiveUserType=ActiveUserType;
app.config.globalProperties.$showNavBar=showNavBar;




app.use(router);




app.mount('#app');
